window.bookSummaryJSON = "<p>The borders between the dimensions are crumbling, yet all Lucius cares about is making Áine his Queen.</p> <p>After surviving Nathaniel's violent plot, Áine is fiercely determined to travel to the Akashic Records and uncover the dark reality behind Lucius's unnatural rise to power. As she strives to fulfill her destiny to free the truth from its binds and restore the natural balance of the Universe, Lucius only grows more adamant that Áine is his—a gift from the heavens that ordained him King. To make matters worse, Nathaniel may have succeeded in planting the seed of doubt into the King's mind, casting Daelon and Áine's relationship under harsh scrutiny.</p> <p>Caught in an escalating, magickal arms race, Lucius and Áine plot against each other and send the entire castle into clashing turmoil in their wake. All the while, Daelon and Áine's dangerous, secret affair only grows more and more volatile and all-consuming. Now everyone is forced to choose a side, and the list of deceits, subterfuge, and cosmic mysteries only grows longer. Who will be left standing when this ethereal castle of lies, pleasure, and magick comes crashing down?</p> <p>Contains mature themes.</p>"; 
